not just my #wcw, but as my brother  @chxta_bee suggested on his post yesterday, i nominate @monica_osee for woman of the year for standing up to predator - oau lecturer richard akindele aka the pervert professor (as i referred to him in my article) . 
monica osagie said #nomore by recording their conversation therefore capturing his sinister offer to increase her mark in exchange to agreeing to be sexually molested by him, on tape. 
i wrote a piece about monica's ordeal when the story broke which was published by @premiumtimes . for me, what monica did was risky, it was costly, it was audacious, and it was the right thing to do.  it could have gone either way, it could have destroyed all her years in education; but to her, the risk was worth it! speaking up is always right ! monica didn't just speak for herself, she stood up for others like her, who are subjected to a barrage terrorising demands by lectures. she unmuffled the voice of many survivors like her. she stood in solidarity with all those who work assiduously to eradicate this plague from our society! 
thank-you monica. you are a brave young woman. we wish you the very best for the future. 
#nomore #womanoftheyear #monicaosagie #sexualharrassmentinuniversities #itmuststop 
#repost @nomore234ng (@get_repost)
